import { useState } from "react"


const [Character , SetCharacter] = useState()
export default MyFetch = (API) => {
    fetch(API)
    .then((res)=>res.json())
    .then((data)=>{
        SetCharacter(prev=> ({ ...data.data,...prev.data}))
        }) 
    }
